export const handleFilters = ({minScore,level}) => {
    return {
        type: 'handleMinScore',
        payload: {
            minScore,
            level
        }
    }
}

export const handleArrange = (arrange) => {
    return {
        type: 'handleArrange',
        payload: arrange
    }
}
